import { motion } from 'framer-motion';
import './About.css';

const About = () => {
  return (
    <motion.section
      className="about-section"
      initial={{ x: '100%' }}
      animate={{ x: 0 }}
      exit={{ x: '-100%' }}
      transition={{ duration: 0.5 }}
    >
      <div className="about-content">
        <h2>About Me</h2>
        <div className="bio">
          <p>I'm a passionate developer with expertise in React...</p>
          {/* Add more bio content */}
        </div>
      </div>
    </motion.section>
  );
};

export default About;
